eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   generateEfoRiro: () => (/* binding */ generateEfoRiro)\n/* harmony export */ });\nfunction generateEfoRiro() {\n    const efoRiroContent = `\n        <div class=\"header1\">\n            <h1>Efo Riro</h1>\n        </div>\n\n            <img src=\"./images/efo-riro-1.jpg\" alt=\"Image of Efo Riro\">\n            <img src=\"./images/efo-riro-2.jpeg\" alt=\"Second Image of Efo Riro\">\n\n            <div class=\"header2\">\n            <h2>Nigerian Efo Riro Recipe</h2>\n            </div>\n\n            <p><strong>Efo Riro</strong> needs no introduction as it’s one of the most popular vegetable soups in Nigeria and an <i>absolute favourite</i> of the <em>Yorubas</em>. It’s quite an easy dish to prepare, as long as you follow the major <mark>instructions and requirements</mark>.</p>\n\n            <p><strong>A major rule is;</strong> using <del>tomatoes</del> for <strong>Efo Riro</strong> is an absolute <b>No No!</b> All you need to use are Bell peppers and Scotch bonnets. Definitely no tomatoes!</p>\n\n            <p>Also, to get the best out of <b>Efo Riro</b>, you need to use Palm Oil. Some people use vegetable oil though but I’m yet to eat any that’s made with vegetable oil that has <em>wowed</em> me. For me, I’ll say <ins>Palm Oil all the way!</ins> If you’ve got health concerns or allergies which limits your Palm Oil consumption, then feel free to use your preferred cooking oil.</p>\n\n            <p><b>Efo Riro</b> doesn’t need too much seasoning, curry, thyme or white pepper are unnecessary. All it needs to thrive is very rich beef/chicken stock, this means you need to properly season your meats as the stock is what really determines the outcome. I hardly add seasoning to it during the cooking process, I just rely on the stock….and my ever faithful Knorr Chicken Cubes.</p>\n\n            <p>Try to use as much <em>assorted meats</em> as you possibly can, the more the variety, the better. <mark>Another tip</mark> is to fry your meats lightly, this helps to firm up the meat and also improves the appearance and taste of your Efo Riro.</p>\n\n            <div class=\"header3\">\n            <h3>Efo Riro Ingredients</h3>\n            </div>  \n            <ul>      \n                <li>2 bunches of Ugwu leaves ( you can also use Spinach or Soko)</li>\n                <li>3 medium or 2 big size bell peppers (Tatashe) and 1½scotch bonnet (Rodo)</li>\n                <li>1/2 cup of Palm Oil</li>\n                <li>1½ medium size red onions</li>\n                <li>Assorted meats of your choice (Shaki, Kpomo, cow leg, smoked turkey or beef are ideal)</li>\n                <li>Dried stockfish (Panla)</li>\n                <li>Smoked cat fish</li>\n                <li>1 tablespoon Locust beans (Iru)</li>\n                <li>½ cup raw/cooked prawns (Optional)</li>\n                <li>¼ cup smoked prawns (Optional)</li>\n                <li>2 Knorr chicken cubes or any bullion cubes of your choosing.</li>\n                <li>3 tablespoons grounded Crayfish</li>\n                <li>Salt to taste</li>\n            </ul>\n\n            <div class=\"header4\">\n            <h4>Cooking Directions/Steps</h4>\n            </div>\n            <ol>      \n                <li>First, get your main ingredients ready. Efo Riro is a fast cooking dish, so you will need to be proactive.</li>\n                <li>Now, season the meats, add sliced onions and boil on medium heat. Remember to boil the tougher meats first, then add the softer ones. Just before it’s fully cooked, add the Stockfish, boil till tender and set aside.</li>\n                <li>Wash your vegetables thoroughly with hot water to rid it of all traces of dirt, be careful not to in soak in hot water for too long so as to retain the nutrients. Slice or chop according to your preference and set aside.</li>\n                <li>Blend the scotch bonnets, bell peppers and an onion coarsely and set aside…</li>\n                <li>Into a large pot, add the palm oil, leave to heat up on medium heat for 2 minutes ….</li>\n                <li>Then add onions, fry till fragrant.</li>\n                <li>Then add the locust beans, fry to release the flavour for another minute….</li>\n                <li>Now add the blended pepper and two Knorr cubes, let that fry for 15-20 minutes thereabouts or until the pepper dries out and the size reduces by almost half….</li>\n                <li>Add a bit of the meat stock/ chicken stock, if you do not have stock, just add water, be careful not to add too much. Just one cup should do.</li>\n                <li>Let it boil for 2-3 minutes to combine, then add the assorted meats, prawns, crayfish, stockfish and catfish.</li>\n                <li>Taste, and adjust seasoning if required. Leave to cook for a further 10 minutes.</li>\n                <li>Now add the washed vegetables, combine thoroughly… Switch off the heat at this time, leave to simmer for a further 5 minutes with the residual heat and it’s ready.</li>\n                <li>Serve with any <q>swallow<q> of your choice. <strong>Efo Riro</strong> is also prefect with <ins>white rice, boiled yam and plantain.</ins></li>\n            </ol>\n\n            <p>This recipe was copied from <a href=\"https://sisijemimah.com/2015/06/29/efo-riro-in-all-its-glory/\">https://sisijemimah.com/2015/06/29/efo-riro-in-all-its-glory/</a> </p>\n            \n            <a href=\"../template.html\">Return to Homepage</a> <a href=\"./egusi-soup.html\">Next</a> <a href=\"efo-riro.html\">Top</a>\n        `;\n     return efoRiroContent;   \n}//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/menu/efo-riro.js\n");

