eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   generateEgusiSoup: () => (/* binding */ generateEgusiSoup)\n/* harmony export */ });\nfunction generateEgusiSoup() {\n    const egusiSoupContent = `\n        <div class=\"header1\">\n        <h1>Egusi Soup</h1>\n        </div>  \n\n        <img src=\"./images/Egusi-soup-1.jpg\" alt=\"Image of Egusi Soup\">    \n        <img src=\"./images/Egusi-Soup-2.jpg\" alt=\"Second Image of Egusi Soup\">\n\n        <div class=\"header2\">\n        <h2>Facts about Nigerian Egusi Soup</h2>\n        </div>\n\n        <p><strong>Egusi</strong> is a West African name for the seeds of plants like squash, melons, and gourds that, when dried and grounded become a staple ingredient in many West African dishes.  Particularly, in Nigerian culture, egusi is popular with pounded yam. These seeds are rich in fat and protein, and add these essential nutrients into West African Cuisine.</p>\n        <p><b>Nigerian Egusi Soup</b> is a soup thickened with grounded melon seeds and contains leafy and other vegetables.  It is one of the most popular soups prepared by most tribes in Nigeria with considerable variation and often eaten with dishes like Pounded Yams.  Prepare it with goat, beef, fish, or shellfish!</p>\n\n        <div class=\"header3\">\n        <h3>Egusi Soup Ingredients</h3>\n        </div>\n        <ul>        \n            <li>1 cup blended onions (about 3- 5 and fresh chilies, to taste)</li>\n            <li>4 cups of Egusi (melon seeds, grinded or milled)</li>\n            <li>½ – 1 cup of palm oil</li>\n            <li>2 teaspoons fresh Iru or locust beans</li>\n            <li>Salt (to taste)</li>\n            <li>Grinded crayfish (to taste)</li>\n            <li>7– 8 cups stock</li>\n            <li>Cooked Meat & fish (quantity and variety to personal preference)</li>\n            <li>2 cups of cut pumpkin leaves</li>\n            <li>1 cup of waterleaf (cut)</li>\n            <li>3 tablespoons bitter leaf (washed)</li>\n        </ul>\n        \n        <div class=\"header4\">\n        <h4>How to cook Nigerian Egusi Soup</h4>\n        </div>\n        <ol>\n            <li>Prepare the egusi paste: Blend egusi seeds and onion mixture. Set aside</li>\n            <li>In a large pot, heat the palm oil on medium for a minute and then add the Iru or Locust beans</li>\n            <li>Slowly add the stock and set on low heat to simmer</li>\n            <li>Scoop teaspoon size balls of the egusi paste mixture into the stock. Be sure to keep ball shape</li>\n            <li>Leave to simmer for 20 – 30 minutes so the balls cook through</li>\n            <li>Add the meat and fish and other bits which you’d like to use</li>\n            <li>Add cut-up pumpkin leaves</li>\n            <li>Add the waterleaf</li>\n            <li>Stir and put a lid on the pot and allow cook for 7–10 minutes, till the leaves wilt</li>\n            <li>Add the bitter leaf.  Leave the lid off while the cooking finishes for another 5-10 minutes</li>\n            <li>Stir, check seasoning and adjust accordingly</li>\n        </ol>\n        <p>Now you can sit back and enjoy your delicious Nigerian Egusi Soup!</p>\n        <p>This Egusi soup recipe was copied from <a href=\"https://demandafrica.com/food/recipes/nigerian-egusi-soup/\">https://demandafrica.com/food/recipes/nigerian-egusi-soup</a>  </p>\n        \n\n        <a href=\"../template.html\">Return to Homepage</a>  <a href=\"./waakye.html\">Next</a> <a href=\"egusi-soup.html\">Top</a>\n    `;\n    return egusiSoupContent;\n};//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/menu/egusi-soup.js\n");

