eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   generateWaakye: () => (/* binding */ generateWaakye)\n/* harmony export */ });\nfunction generateWaakye() {\n    const waakyeContent = `\n        <div class=\"header1\">\n        <h1>Waakye</h1>\n        </div>\n\n        <img src=\"./images/Waakye-1.jpg\" alt=\"Waakye Image\">\n        <img src=\"./images/Waakye-2.jpeg\" alt=\"Second image of Waakye\">\n        <img src=\"./images/Waakye-3.jpeg\" alt=\"Third image of Waakye\">\n\n        <div class=\"header2\">\n            <h2>Introduction to Waakye</h2>\n        </div>    \n\n            <p><strong>Waakye</strong> is a supremely popular morning meal in Ghana but can be eaten throughout the day. Filling and flavourful, it combines beans, rice, moist gari (ground cassava), stew and spaghetti (the only non-Ghanaian part of the dish).</p>\n\n            <p>This is one of the most cherished Ghanaian dish in most households in Ghana. As the name suggests, the main ingredients in this dish are; rice and beans which are both boiled in water with millet leaves till they become soft. The delicacy is named after the millet leaves which are locally referred to as <mark>waakye.</mark></p>\n\n            <p>It is normally accompanied by yellowish granulated cassava, tomato sauce, and a hot black pepper sauce referred to as ‘shito’. Waakye is eaten with mostly cow meat and eggs, but others also add chicken or guinea fowl.</p>\n\n            <p><b>Waakye</b> is commonly eaten for breakfast or lunch. It is usually served with a choice of protein, so you can choose from;   \n            <ul>\n                <li>Salads</li>\n                <li>Spaghetti</li>\n                <li>Fried plantains</li>\n                <li>Garri</li>\n                <li>Meat, boiled eggs and fish</li>\n            </ul>\n            </p>\n\n        <div class=\"header3\">\n            <h3>Waakye Ingredients</h3>\n        </div>\n        \n        <div class=\"header4\">\n            <h4>How to cook Waakye</h4>\n        </div>\n        \n            <div class=\"ul-adjusted\">        \n            <li>2 cups of black eyed beans</li>\n            <li>2-4 dried millet stalk leaves</li>\n            <li>4 cups of jasmine rice</li>\n            <li>3 tbsp of oil</li>\n            <li>salt to taste</li>          \n            </div>\n    \n        <div class=\"ol-adjusted\">       \n            <li>Pick stones and grits from the beans</li>\n            <li>Wash the beans and add into the pressure cooker</li>\n            <li>Wash the waakye leaves and also add into the pressure cookers. Pour in water up to the minimum level on the pot</li>\n            <li>Close the valve of the pressure cooker and leave until it reaches full pressure. This should take no more than 15 mins</li>\n            <li>Once it reaches full pressure, reduce the heat and leave for additional 10 mins for the beans to cook</li>\n            <li>Remove from heat and allow to cool down naturally to depressurize. This should take around 20 mins</li>\n            <li>Once the pot is adequately cooled. Unlock the lid. Pour the beans with the cooking liquid and the waakye leaves into another pot. Wash the rice and pour into the pot too</li>\n            <li>Add more water if needed so there is enough to cook the rice. Add some salt and cover the pot</li>\n            <li>Allow the rice to cook. The time for this depends on the type of rice used. Check pack instructions if you are not sure</li>\n            <li>Remove the waakye leaves and serve with your favorite side</li>              \n            </div>\n\n            <p>This recipe was copied from <a href=\"https://afrifoodnetwork.com/recipes/rice-recipes/waakye/\">https://afrifoodnetwork.com/recipes/rice-recipes/waakye/</a></p>\n            \n        <a href=\"../template.html\">Return to Homepage</a> <a href=\"waakye.html\">Top</a>\n    `;\n    return waakyeContent;\n};//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/menu/waakye.js\n");

